$(function(){var t=[];$.getJSON("data/file_list.json",function(n){$.each(n,function(n,e){t[n]=e.split(".")[0]})}).done(function(){$("tbody tr").each(function(){for(var n=0;n<t.length;n++){if($(this).children("td:last-child").text()==t[n]){$(this).append('<td class="center"><a href="../html/'+t[n]+'.html" class="list-link" target="blonk"> DONE </a></td>');break}n==t.length-1&&$(this).append('<td class="center">X</td>')}})})});